    DoSomethingElse()
}

func (m *myType) DoSomething() {
    \/\/ Do something
}

func (m *myType) DoSomethingElse() {
    \/\/ Do something else
}
```
6. Methods with same name and different parameters: Interfaces can define methods with the same name but with different parameters. For example:
```
type MyInterface interface {
    DoSomething(int)
    DoSomething(string)
}

func (m *myType) DoSomething(int i) {
    \/\/ Do something with int
}

func (m *myType) DoSomething(string s) {
    \/\/ Do something with string
}
```
7. Interfaces and inheritance: Interfaces can be used to define a hierarchy of related types, allowing for polymorphism. For example:
```
type Animal interface {
    MakeSound()
}

type Mammal interface {
    MakeSound()
    Feed()
}

type Cat struct{}

func (m *Cat) MakeSound() {
    \/\/ Meow
}

func (m *Cat) Feed() {
    \/\/ Eat some milk
}

func main() {
    var cat Cat
    cat.MakeSound() \/\/ Meow
    cat.Feed() \/\/ Eat some milk
}
```
