Now, you can use the following JavaScript code to filter out the elements without children:
```javascript
const _ = require('lodash');

function hasChildren(node) {
  return !_.isObject(node) || _.filter(node, hasChildren).length > 0;
}

function filterNodesWithoutChildren(tree) {
  return _.filter(tree, (value, key) => {
    if (hasChildren(value)) {
      return value;
    } else {
      return _.omit(value, (nestedValue, nestedKey) => {
        return !hasChildren(nestedValue);
      });
    }
  });
}

const nodesWithoutChildren = filterNodesWithoutChildren(tree);
console.log(nodesWithoutChildren);
