Creating a Terraform module for API Gateway that pushes REST POST requests to DynamoDB directly involves a few steps. Here's a high-level overview of the process:

1. Define the API Gateway Resource and Method:
   - Define an API Gateway resource for the REST endpoint (e.g., \/resource) and create a POST method for it.

2. Configure Integration with Lambda Proxy:
   - Create a Lambda function that will handle the POST request and interact with DynamoDB.
   - Configure the API Gateway POST method to integrate with the Lambda function using the Lambda Proxy integration.

3. Set Up DynamoDB Table:
   - Define the DynamoDB table that will store the data from the POST requests.

4. Write Terraform Module:
   - Write a Terraform module that encapsulates the configuration for the API Gateway, Lambda function, and DynamoDB table.
   - Define input variables for the module to customize the API endpoint, DynamoDB table name, etc.

Here's a simplified example of what the Terraform module might look like:

```hcl
# main.tf

variable "api_name" {
  description = "Name of the API Gateway"
}

variable "dynamodb_table_name" {
  description = "Name of the DynamoDB table"
}

resource "aws_api_gateway_rest_api" "api" {
  name = var.api_name
}

resource "aws_api_gateway_resource" "resource" {
  rest_api_id = aws_api_gateway_rest_api.api.id
  parent_id   = aws_api_gateway_rest_api.api.root_resource_id
  path_part   = "resource"
}

resource "aws_api_gateway_method" "post_method" {
  rest_api_id   = aws_api_gateway_rest_api.api.id
  resource_id   = aws_api_gateway_resource.resource.id
  http_method   = "POST"
  authorization = "NONE"
}

resource "aws_lambda_function" "dynamodb_writer" {
  function_name = "dynamodb_writer"
  # Other Lambda function configuration...

  # Define your Lambda function code here...
}

