    function moveYellowFish(event) {
      const dx = event.clientX - yellowFish.x;
      const dy = event.clientY - yellowFish.y;
      yellowFish.x += dx;
      yellowFish.y += dy;
    }

    function generateRedFish() {
      const x = Math.random() * canvas.width;
      const y = Math.random() * canvas.height;
      const speed = Math.random() * 2 + 1;
      redFish.push({ x, y, speed });
    }

    function updateRedFish() {
      redFish.forEach((fish) => {
        fish.y += fish.speed;
        if (fish.y > canvas.height) {
          fish.y = 0;
          fish.x = Math.random() * canvas.width;
        }
      });
    }

    function draw() {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      ctx.fillStyle = "yellow";
      ctx.fillRect(yellowFish.x, yellowFish.y, 50, 50);

      redFish.forEach((fish) => {
        ctx.fillStyle = "red";
        ctx.fillRect(fish.x, fish.y, 20, 20);
      });

      ctx.font = "24px Arial";
      ctx.fillStyle = "black";
      ctx.textAlign = "center";
      ctx.textBaseline = "top";
      ctx.fillText(`Score: ${score}`, canvas.width \/ 2, 20);

      updateRedFish();
      yellowFish.x += 2;
    }

    function gameLoop() {
      requestAnimationFrame(gameLoop);
      draw();
    }

    gameLoop();

    document.addEventListener("keydown", (event) => {
