To achieve this, you can use the lodash `filter` and `omit` functions along with a custom function to check if an element has children. First, let's assume you have a tree structure with nested objects:
```javascript
const tree = {
  a: {
    b: {
      c: {},
      d: {}
    },
    e: {}
  },
  f: {},
  g: {}
};
```
Now, you can use the following JavaScript code to filter out the elements without children:
```javascript
const _ = require('lodash');

function hasChildren(node) {
  return !_.isObject(node) || _.filter(node, hasChildren).length > 0;
}

function filterNodesWithoutChildren(tree) {
  return _.filter(tree, (value, key) => {
    if (hasChildren(value)) {
      return value;
    } else {
      return _.omit(value, (nestedValue, nestedKey) => {
        return !hasChildren(nestedValue);
      });
    }
  });
}

const nodesWithoutChildren = filterNodesWithoutChildren(tree);
console.log(nodesWithoutChildren);
```
In this code:

1. The `hasChildren` function checks if a node has children by using the `filter` function to check for nested objects.
2. The `filterNodesWithoutChildren` function uses the `filter` function to iterate through the tree and apply the `hasChildren` function to each node. If a node has children, it is included in the result. If not, the `omit` function is used to remove the node.
3. The `nodesWithoutChildren` variable will contain the tree with the elements without children.

Please make sure you have the lodash library installed in your project before running the code.
